import React, { Component } from 'react';
import { Header, Content, ContentFunctional } from './components/header/header';
import { TableRow } from './components/table/table';
import './App.css';

class App extends Component {

   constructor(props) {
      super(props);
      this.state = { Counter: 1 };
      this.state = {
         data:
            [
               {
                  "id": 1,
                  "name": "Foo",
                  "age": "20"
               },
               {
                  "id": 2,
                  "name": "Bar",
                  "age": "30"
               },
               {
                  "id": 3,
                  "name": "Baz",
                  "age": "40"
               }
            ]
      }
   }

   updateCount = () => {
      this.setState({ Counter: this.state.Counter + 1 })
   }

   handleCount = () => {
      this.setState({});
   }
   render() {
      setTimeout(() => {
         this.updateCount();
      }, 5000);
      return (
         <div>
            <Header></Header>
            <Content text="Paragraph"></Content>
            <ContentFunctional text="text"></ContentFunctional>
            <p>
               {this.props.headerProps}
            </p>

            <p>{
               this.props.contentProps}
            </p>
            <table>
               <thead>
                  <tr>
                     <th>ID</th>
                     <th>Name</th>
                     <th>Age</th>
                  </tr>
               </thead>
               <tbody>
                  {
                     this.state.data.map((personData, i) => <TableRow key={i}
                        data={personData} />)
                  }
               </tbody>
            </table>
         </div>
      );
   }
}

App.defaultProps = {
   headerProps: "This is header Props",
   contentProps: " this is content props"
}

App.prototype = {
   propBool : React.PropTypes.bool,
   propNumber : React.PropTypes.number,
   propString : React.PropTypes.string
}

export default App;
